import { StyledAbout } from "./styles/About.styled";
import aboutIcon from "../assets/aboutIcon.svg";

const About = () => {
  return (
    <StyledAbout>
      <img src={aboutIcon} alt="person on couch with cat" />
      <div>
        <h1>About</h1>
        <p>
          I am a Front-End Developer living in San Diego, California. I am very
          passionate about everything that I do, and love to create things with
          other people.
        </p>
        <p>
          I love to solve problems and give high attention to detail in
          everything that I do. In my free time I am usually playing video games
          or playing my Stratocaster.
        </p>
      </div>
    </StyledAbout>
  );
};

export default About;
